INSERT INTO `attacker` VALUES ('2', 'Amar', 'Uma', '-5918d163896d0f4ed3c0e8409093e2a21ed349aa', 'Dengue fever is a mosquito-borne tropical disease caused by the dengue virus.Symptoms typically begin three to fourteen days after infection.[2] This may include a high fever, headache, vomiting, muscle and joint pains, and a characteristic skin rash.[1][2] Recovery generally takes two to seven days.[1] In a small proportion of cases, the disease develops into the life-threatening dengue hemorrhagic fever, resulting in bleeding, low levels of blood platelets and blood plasma leakage, or into dengue shock syndrome, where dangerously low blood pressure occurs.This is not dengue', '07/10/2018   18:57:59');
